    function createTableByChartInteraction(data1, str, areaType){
        var features1 = data1.features;
        var AreaTypes = new Array();
        var RoadTypes = new Array();
        var RoadSubTypes = new Array();
        for (var i = 0; i < features1.length; i++){
            if (!AreaTypes.includes(parseInt(features1[i].properties.ATYPE))){
                AreaTypes.push(parseInt(features1[i].properties.ATYPE));
            }
            if (!RoadTypes.includes(parseInt(features1[i].properties.FUNCL))){
                RoadTypes.push(parseInt(features1[i].properties.FUNCL));
            }
            if (!RoadSubTypes.includes(parseInt(features1[i].properties.FTYPE))){
                RoadSubTypes.push(parseInt(features1[i].properties.FTYPE));
            }
        }
        AreaTypes = AreaTypes.sort(function(a, b){ return a - b; });
        RoadTypes = RoadTypes.sort(function(a, b){ return a - b; });
        RoadSubTypes = RoadSubTypes.sort(function(a, b){ return a - b; });
        var dict = {};
        for (var i = 0; i < RoadTypes.length; i++){
            dict[RoadTypes[i]] = {};
        }
        var dictLengthFirstLevel = Object.keys(dict).length;
        for (var i = 0; i < dictLengthFirstLevel; i++){
            var tempLookupArrayForSubType = roadTypeToRoadSubType[RoadTypes[i]];
            for (var j = 0; j < RoadSubTypes.length; j++){
                if (tempLookupArrayForSubType.includes(RoadSubTypes[j])){
                    var areaTypeDict = {};
                    areaTypeDict["Type"] = reverseLookupTable1[RoadTypes[i]][RoadSubTypes[j]];
                    for (var k = 0; k < AreaTypes.length; k++){
                        areaTypeDict[AreaTypes[k]] = 0;
                    }
                    areaTypeDict["Total"] = 0;
                    dict[RoadTypes[i]][RoadSubTypes[j]] = areaTypeDict;
                }
            }
        }
        for (var i = 0; i < features1.length; i++){
            dict[parseInt(features1[i].properties.FUNCL)][parseInt(features1[i].properties.FTYPE)][parseInt(features1[i].properties.ATYPE)] += 1;
        }
        for (var key in dict){
            for (var key1 in dict[key]){
                var rowSum = 0;
                for (var i = 0; i < AreaTypes.length; i++){
                    rowSum += dict[key][key1][AreaTypes[i]]
                }
                dict[key][key1]["Total"] = rowSum;
            }
        }
        for (var i = 0; i < RoadTypes.length; i++){
            var areaTypeDict = {};
            areaTypeDict["Type"] = reverseLookupTable2[RoadTypes[i]];
            for (var k = 0; k < AreaTypes.length; k++){
                areaTypeDict[AreaTypes[k]] = 0;
                for([key, val] of Object.entries(dict[RoadTypes[i]])) {
                    areaTypeDict[AreaTypes[k]] += val[AreaTypes[k]];
                }
            }
            areaTypeDict["Total"] = 0;
            for ([key, val] of Object.entries(dict[RoadTypes[i]])){
                areaTypeDict["Total"] += val["Total"];
            }
            dict[RoadTypes[i]]["TypeSummary"] = areaTypeDict;
        }
        var lastRowAreaTypeDict = {};

        for (var i = 0; i < AreaTypes.length; i++){
            var areaTypeSum = 0;
            for (var key in dict){
                for (var key1 in dict[key]){
                    if (key1 != "TypeSummary"){

                    }
                }
            }
            lastRowAreaTypeDict[AreaTypes[i]] = areaTypeSum
        }
        var overallTotal = 0;

            for (var key1 in dict[key]){
                if (key1 == "TypeSummary"){
                    overallTotal += dict[key][key1]["Total"];
                }
            }
        }
        lastRowAreaTypeDict["Total"] = overallTotal;
        dict["lastRow"] = {0:lastRowAreaTypeDict};
        console.log(dict);
        if (str == "Total"){

            let tbody = document.createElement("tbody")
            let tfoot = document.createElement("tfoot");

            let heading_1 = document.createElement("th");
            heading_1.innerHTML = "FUNCL";
            row1.appendChild(heading_1);
            let heading_2 = document.createElement("th");
            heading_2.innerHTML = "FTYPE";
            row1.appendChild(heading_2);
            let heading_3 = document.createElement("th");
            heading_3.innerHTML = areaType;
            row1.appendChild(heading_3);
            thead.appendChild(row1);
            table1.append(thead);
            for (var i = 0; i < RoadTypes.length; i++){
                let blockRow = document.createElement("tr");
                blockRow.style.backgroundColor = roadTypeColor[RoadTypes[i]];
                let blockIndex = document.createElement("th");
                blockIndex.innerHTML = RoadTypes[i];
                blockRow.appendChild(blockIndex);
                let blockName = document.createElement("td");
                blockName.innerHTML = reverseLookupTable2[RoadTypes[i]];
                blockRow.appendChild(blockName);
                let AreaTypeNumber = document.createElement("td");
                AreaTypeNumber.innerHTML = dict[RoadTypes[i]]["TypeSummary"][reverseLookupTableAreaType1[areaType]];
                blockRow.appendChild(AreaTypeNumber);
                tbody.appendChild(blockRow);
                for ([key, val] of Object.entries(dict[RoadTypes[i]])){
                    if (key != "TypeSummary"){
